import '../Header/header.css'
import { Box } from "@mui/system";
import logo from "../Header/education.png"
import { Avatar } from "@mui/material";


function Header(){

    return(
        <Box sx={{background:"#A03037",
                 width:'100vw',
                 height:'8vh',
                 display:'flex',
                 flexDirection:'row'
                 }}>
                     <Box  sx={{width:20,
                             height:'100%',
                             display:'flex',
                            flexDirection:'row',
                            justifyContent:'center',
                            alignItems:'center'
                    }}>
                         <Avatar>
                         src={logo}
                         </Avatar>


                    </Box>
                     <Box></Box>
                     <Box></Box>

        </Box>


    )




}

export default Header
